class Product{
    #name;
    #description; 
    #price;
    #amount;
    #id

    constructor(n,d,p,i){
        this.#name = n;
        this.#description  = d;
        this.#price = p;
        this.#amount = 0; 
        this.#id = i; 
    }

    get name() {return this.#name;}
    get description() {return this.#description;}
    get price() {return this.#price;}
    get amount() {return this.#amount;}
    get id() {return this.#id;}
    /**
     * @param {number} val
     */
    set amount(val) {this.#amount = val;}

}


export default Product;
